function CreateBank(){var a="api.bank.php",e=$("#code").val(),n=$("#branch").val(),r=$("#name").val(),o=$("#number").val();$.ajax({url:a,cache:!1,dataType:"json",type:"POST",data:{calling:"Bank",action:"CreateBank",code:e,branch:n,name:r,number:o},error:function(){console.log("Request Error")}}).done(function(a){console.log("Return: "+a.message)}).error()}